def getTop10andBottom10(original_withNames, weights):
	weights_sorted = copy.deepcopy(weights)
	weights_sorted.sort()

	top10=[]
	least10=[]

	for i in range(0,12):
		least10.append(weights_sorted[i])
		top10.append(weights_sorted[-1*(i+1)])

	#print top10
	#print least10

	getIndex_w_top10=[]
	getIndex_w_least10=[]
	for i in top10:
		getIndex_w_top10.append(	weights.index(i)	)
	for i in least10:
		getIndex_w_least10.append(	weights.index(i)	)
	#print getIndex_w_top10
	#print getIndex_w_least10
	print("\nsmallest weights")
	for i in getIndex_w_least10:
		print(original_withNames[i])
	print("\ngreatest weights")
	for i in getIndex_w_top10:
		print(original_withNames[i])

